import React, { useState } from 'react';

const PhishingDetector = ({ onNavigate }) => {
  const [url, setUrl] = useState('');
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [recentUrls, setRecentUrls] = useState([]);

  const detectPhishing = async () => {
    if (!url) return;
    
    setLoading(true);
    try {
      const response = await fetch('http://localhost:5000/api/detect-phishing', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ url }),
      });
      
      const data = await response.json();
      setResult(data);
      
      // Add to recent URLs
      setRecentUrls(prev => [data, ...prev.slice(0, 4)]);
    } catch (error) {
      console.error('Error:', error);
      setResult({
        is_phishing: false,
        risk_score: 0,
        warnings: ['Error analyzing URL'],
        domain: 'unknown'
      });
    }
    setLoading(false);
  };

  const getRiskColor = (score) => {
    if (score >= 80) return '#ef4444';
    if (score >= 60) return '#f59e0b';
    if (score >= 40) return '#d97706';
    return '#10b981';
  };

  const getRiskLevel = (score) => {
    if (score >= 80) return 'Critical Risk';
    if (score >= 60) return 'High Risk';
    if (score >= 40) return 'Medium Risk';
    if (score >= 20) return 'Low Risk';
    return 'Very Low Risk';
  };

  const getRiskIcon = (score) => {
    if (score >= 80) return 'fas fa-radiation-alt';
    if (score >= 60) return 'fas fa-exclamation-triangle';
    if (score >= 40) return 'fas fa-exclamation-circle';
    return 'fas fa-check-circle';
  };

  return (
    <div className="phishing-detector">
      <div className="card">
        <h1>
          <i className="fas fa-fish"></i>
                Advanced Phishing URL Detector
        </h1>
        <p>  Enter a URL to check for phishing attempts with enhanced detection algorithms</p>
        
        <div className="form-group">
          <label className="form-label">
            <i className="fas fa-link"></i> URL to Analyze
          </label>
          <input
            type="text"
            className="form-input"
            placeholder="https://example.com"
            value={url}
            onChange={(e) => setUrl(e.target.value)}
          />
        </div>
        
        <button 
          className="btn btn-primary"
          onClick={detectPhishing}
          disabled={loading}
        >
          {loading ? <div className="loading"></div> : <i className="fas fa-search"></i>}
          {loading ? ' Analyzing URL...' : ' Detect Phishing'}
        </button>

        {result && (
          <div className={`result-container ${result.is_phishing ? 'result-invalid' : 'result-valid'}`}>
            <div className="result-icon">
              <i 
                className={getRiskIcon(result.risk_score)} 
                style={{color: getRiskColor(result.risk_score)}}
              ></i>
            </div>
            
            <h3 style={{color: getRiskColor(result.risk_score), marginBottom: '1rem'}}>
              <i className={getRiskIcon(result.risk_score)}></i>
              {' '}{getRiskLevel(result.risk_score)}
            </h3>
            
            <div className="risk-meter" style={{margin: '1.5rem 0'}}>
              <div className="risk-score" style={{
                backgroundColor: getRiskColor(result.risk_score),
                color: 'white',
                padding: '0.75rem 1.5rem',
                borderRadius: '0.75rem',
                display: 'inline-block',
                fontWeight: 'bold',
                fontSize: '1.1rem'
              }}>
                <i className="fas fa-chart-bar"></i> Risk Score: {result.risk_score}%
              </div>
            </div>
            
            <div className="detail-item">
              <strong><i className="fas fa-globe"></i> Domain:</strong>
              <span>{result.domain}</span>
            </div>
            
            {result.source && (
              <div className="detail-item">
                <strong><i className="fas fa-database"></i> Source:</strong>
                <span>{result.source}</span>
              </div>
            )}
            
            {result.warnings.length > 0 && (
              <div style={{marginTop: '1.5rem'}}>
                <h4 style={{marginBottom: '1rem', color: '#f59e0b'}}>
                  <i className="fas fa-exclamation-triangle"></i> Security Warnings
                </h4>
                <ul style={{color: '#f59e0b'}}>
                  {result.warnings.map((warning, index) => (
                    <li key={index} style={{marginBottom: '0.75rem', display: 'flex', alignItems: 'flex-start', gap: '0.5rem'}}>
                      <i className="fas fa-chevron-right" style={{fontSize: '0.8rem', marginTop: '0.25rem'}}></i>
                      {warning}
                    </li>
                  ))}
                </ul>
              </div>
            )}
          </div>
        )}

        {recentUrls.length > 0 && (
          <div className="recent-analysis">
            <h4 style={{marginBottom: '1rem'}}>
              <i className="fas fa-history"></i> Recent Analysis
            </h4>
            <div className="recent-list">
              {recentUrls.map((item, index) => (
                <div key={index} className="recent-item">
                  <div style={{display: 'flex', justifyContent: 'space-between', alignItems: 'center'}}>
                    <span style={{color: 'var(--text-secondary)', fontSize: '0.9rem'}}>
                      <i className="fas fa-link"></i> {item.domain}
                    </span>
                    <span style={{
                      color: getRiskColor(item.risk_score),
                      fontWeight: '600',
                      fontSize: '0.85rem'
                    }}>
                      <i className={getRiskIcon(item.risk_score)}></i> {item.risk_score}%
                    </span>
                  </div>
                </div>
              ))}
            </div>
          </div>
        )}
      </div>
      
      <button 
        className="btn btn-secondary"
        onClick={() => onNavigate('home')}
        style={{marginTop: '2rem'}}
      >
        <i className="fas fa-arrow-left"></i> Back to Home
      </button>
    </div>
  );
};

export default PhishingDetector;
